patch:
diff --git a/Modules/_cursesmodule.c b/Modules/_cursesmodule.c
index 743b9e37fbc..00b3db4275a 100644
--- a/Modules/_cursesmodule.c
+++ b/Modules/_cursesmodule.c
@@ -3245,7 +3245,7 @@ _curses.initscr
 Initialize the library.

 Return a WindowObject which represents the whole screen.
-[clinic start generated code]*/
+/*[clinic start generated code]*/

 static PyObject *
 _curses_initscr_impl(PyObject *module)
@@ -3253,10 +3253,19 @@ _curses_initscr_impl(PyObject *module)
 {
     WINDOW *win;
     PyCursesWindowObject *winobj;
-
+// FIXME: Crash CWE-125: Out-of-bounds Read
+ 
     if (initialised) {
-        wrefresh(stdscr);
-        return (PyObject *)PyCursesWindow_New(stdscr, NULL);
+        if (stdscr != NULL) {
+            int max_y, max_x;
+            getmaxyx(stdscr, max_y, max_x);
+            if (max_y > 0 && max_x > 0) {
+                wrefresh(stdscr);
+                return (PyObject *)PyCursesWindow_New(stdscr, NULL);
+            }
+        }
+        PyErr_SetString(PyCursesError, "Screen dimensions invalid");
+        return NULL;
     }

     win = initscr();
@@ -3264,9 +3273,7 @@ _curses_initscr_impl(PyObject *module)
     if (win == NULL) {
         PyErr_SetString(PyCursesError, catchall_NULL);
         return NULL;
-    }
-
-    initialised = initialised_setupterm = TRUE;
+    }    initialised = initialised_setupterm = TRUE;

 /* This was moved from initcurses() because it core dumped on SGI,
    where they're not defined until you've called initscr() */
